import React, { Component } from 'react';

class NameForm extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      name: '',
      max_players: ''
    };
    this.handleChange = this.handleChange.bind(this);
    this.handleSubmit = this.handleSubmit.bind(this);
  }

  handleChange(event) {    this.setState({name: event.target.name});  }
  handleSubmit(event) {
    console.log('A name was submitted: ' + this.state.name);
    event.preventDefault();
  }

  render() {
    return (
      <form onSubmit={this.handleSubmit}>        
        <label>
          Name:
          <input type="text" name={this.state.name} onChange={this.handleChange} />        
        </label>
        <label>
          Max players:
          <input type="text" max_players={this.state.max_players} onChange={this.handleChange} />        
        </label>
        <input type="submit" name="Submit" />
      </form>
    );
  }
}
class Login extends Component {

  constructor () {
    super();
    this.state = {
      email: '',
      password: ''
    };
    this.handleChange = this.handleChange.bind(this);
  }

  handleChange (evt) {
    // check it out: we get the evt.target.name (which will be either "email" or "password")
    // and use it to target the key on our `state` object with the same name, using bracket syntax
    this.setState({ [evt.target.name]: evt.target.value });
    console.log("Nombre" + this.state.email);
    console.log("Jugadores" + this.state.password);
  }

  render () {
    return (
      <form>

        <label>Email</label>
        <input type="text" name="email" onChange={this.handleChange} />

        <label>Password</label>
        <input type="password" name="password" onChange={this.handleChange} />

        <input type="submit" name="Submit" />
      </form>
    );
  }
}

class Partida extends Component {
  render() {
    return (
        <div>
          <Login/>
        </div>
    );
  }
}

export default Partida;
